import React from "react";
import Input from "./Input";
import "./Ongoing.css";
import { AiFillMinusCircle } from "react-icons/ai";

const Ongoing = () => {
  return (
    <div>
      <h2>On going</h2>
      <div className="task">
        <Input />
        <AiFillMinusCircle />
      </div>
      <Input />
      <Input />
    </div>
  );
};

export default Ongoing;
